import'./Main.css';


function Main() {
  return (
    <div className="card">
      <div class='cards'>
      <div class='card1'><img src="https://cdn-icons-png.flaticon.com/128/3444/3444339.png"/> card1</div>
      <div class='card2'>card2</div>   
      <div class='card3'>card3</div>
      <div class='card3'>card4</div>
    </div>
    </div>
  )
}

export default Main;
